import Dropdown from "./Dropdown";
import {useState} from "react";

const MenuItems = ({ items }) => {

    return (
        <li>
            {items.submenu ? (
                <>
                    <a className="header_navi_link" aria-haspopup="menu">
                        {items.title}{""}
                    </a>
                    <Dropdown submenus={items.submenu}/>
                </>
            ) : (
                <a className="header_navi_link" href={items.url}>{items.title}</a>
            )}
        </li>
    );
};

export default MenuItems;
